import React from "react";

function App() {
  return <GrandFather />;
}

function GrandFather() {
  return <Mother />;
}

function Mother() {
  return Son;
}

function Son() {
  return <div>할아버지에게 호출당한 엄마에게 호출당한 아들입니다</div>
}

export default App;
